      image: require("../../images/products/prod2.png")
    },
    {
      id: 2,
      name: "Tin can",
      price: 199,
      image: require("../../images/products/prod2.png")
    },
    {
      id: 3,
      name: "Tin can",
      price: 199,
      image: require("../../images/products/prod2.png")
    },
    {
      id: 4,
      name: "Tin can",
      price: 199,
      image: require("../../images/products/prod2.png")
    },
    {
        id: 5,
        name: "Tin can",
        price: 199,
        image: require("../../images/products/prod2.png")
      },
  ]


export default products
